import styled from 'styled-components';

export const Div = styled.div`
  position: absolute;
  left: 0px;
  top: 0px;
`

export const Button = styled.button`
  color: black;
  float: left;
  padding: 8px 16px;
  text-decoration: none;
  transition: background-color .3s;
  &:hover {background-color: #ddd}
`
